const canvas = document.getElementById('mazeCanvas');
const ctx = canvas.getContext('2d');
const ball = { x: 20, y: 20, radius: 10 }; // Initial position of the ball
const ballColor = 'red';

// Load the maze image
const mazeImage = new Image();
// mazeImage.src = 'maze.png';
mazeImage.src = 'data:image/png;base64,'
mazeImage.onload = function() {
  canvas.width = mazeImage.width;
  canvas.height = mazeImage.height;
  ctx.drawImage(mazeImage, 0, 0);
  drawBall();
};

function drawBall() {
  ctx.fillStyle = ballColor;
  ctx.beginPath();
  ctx.arc(ball.x, ball.y, ball.radius, 0, Math.PI * 2);
  ctx.fill();
}

window.addEventListener('deviceorientation', function(event) {
  let newX = ball.x + event.gamma * 0.1;
  let newY = ball.y + event.beta * 0.1;
  
  if (!isColliding(newX, newY)) {
    ball.x = newX;
    ball.y = newY;
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.drawImage(mazeImage, 0, 0);
    drawBall();
  }
});

function isColliding(x, y) {
  const pixelData = ctx.getImageData(x, y, 1, 1).data;
  const grayscale = (pixelData[0] + pixelData[1] + pixelData[2]) / 3; // Average RGB to get an approximation of grayscale
  return grayscale < 100; // Returns true if the pixel is part of a wall
}

